import "./App.css";

function App() {
  const handleText = (ev) => {
    const listenText = ev.target.value;
    console.log("funciono");
    console.log(listenText);
  };
  return (
    <>
      <input type="text" className="App" onKeyUp={handleText} />
      <p copyText={listenText}></p>
    </>
  );
}

export default App;
